import React from 'react';
import { Link } from 'react-router-dom';
import Image from '../img/plantlogo.jpg'
import { Avatar, Button } from 'antd';

const Navigation = () => {
  return (
    <>
    <nav id='navigation'>
        <div id='navBar' href='#home'>

            <div id='logoWrap'>
                <img id='logopic' src={Image} 
                />

            </div>

        </div>

        <div id='navBtn'>

            <Button className="navBtns"><Link to='/login'>Login</Link></Button>


            <Button className="navBtns"><Link to='/signup'>Sign Up</Link></Button>

        </div>
    </nav>
    </>
  );
};
export default Navigation;
